import React from "react";
import "./src/assets/iphone.png"

const ItemDetail =({detalles})=>{
    const imagen = detalles.images[0]
    return(
        
        <>
        <h1>Aqui esto es {detalles.id} </h1>
        <img src={imagen} alt="" />
  
        
        </>
    )

}

export default ItemDetail
